  if (languageSection) {
    return (
      <div className="flex gap-1  pl-4 pr-4 pt-4 font-source_san_3 font-bold text-2xl">
        <div className="flex-1 flex-col">
          <h4>Skills</h4>
          {children}
        </div>
        <div className="flex-1 flex-col">
          <h4>Software</h4>
          {children}
        </div>
        <div className="flex-1 flex-col">
          <h4>Language</h4>
          {children}
        </div>
      </div>
    );
  } else {
    return (
      <div className="flex gap-1  pl-4 pr-4 pt-4 font-source_san_3 font-bold text-2xl">
        <div className="flex-1 flex-col">
          <h4>Skills</h4>
          {children}
        </div>
        <div className="flex-1 flex-col">
          <h4>Software</h4>
        </div>
      </div>
    );
  }
};

export default SoftwareUsed;
